  }
  render() {
    const { dropdownText } = this.state
    return (
      <div>
        <Navbar />
        <Dropdown clicked={(event) => this.handleClick(event.target.value)} />
        <div>{dropdownText}</div>
      </div>
    );
  }
}

export default HomePage;
